post_text:
Congratulations to the ten 5th, 6th, and 7th grade students from Union Township who were selected as winners in the Tri-county Literacy Council's Young Authors contest! Congratulations to their teachers as well: Mrs. Francis, Mrs. Bercaw, Ms. Barrett, and Mrs. Pryor.

Grade 5:
Caroline DaSilva, 1st place, personal narrative; Dylan Cowell, 2nd place, personal narrative; Phoebe Rodriguez, 3rd place, poetry.

Grade 6:
Lucy Sklar, 1st place, poetry;
Max Sklar, 2nd place, poetry (tie);
Madelyn McKinley, 2nd place, poetry (tie); Anjali Datla, 1st place, short story;
Samantha Shustack, 2nd place, short story.

Grade 7:
Julie Zengel, 1st place, poetry; Maddie Proulx, 2nd place, personal narrative.

